import React from 'react';
import Header from '../widget/Header';
import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";
import Button from "@material-ui/core/Button";
import './dashboard.css';

const useStyles = makeStyles((theme) => ({
    box: {
      height: 200,
      display: "inline-block",
      border: "1px solid black",
      padding: 8
    },
    topLeftBox: {
      justifyContent: "flex-start",
      alignItems: "flex-start"
    },
    centerBox: {
      justifyContent: "center",
      alignItems: "center"
    },
    bottomRightBox: {
      justifyContent: "flex-end",
      alignItems: "flex-end"
    },
    spreadBox: {
      justifyContent: "space-between",
      alignItems: "center"
    }
  }));

const Dashboard = () => {

    const classes = useStyles();

    return(
        <div className="body">
            <Header />
            <div>
                <Box
                    component="span"
                    m={1} //margin
                    className={`${classes.topLeftBox} ${classes.box}`}
                >
                    <Button variant="contained" color="primary" style={{ height: 40 }}>
                        Primary
                    </Button>
                </Box>
                <Box
                    component="div"
                    m={1}
                    className={`${classes.centerBox} ${classes.box}`}
                >
                    <Button variant="contained" color="primary" style={{ height: 40 }}>
                        Primary
                    </Button>
                </Box>
                <Box
                    component="span" //uses different element but default styling is same
                    m={1}
                    className={`${classes.bottomRightBox} ${classes.box}`}
                >
                    <Button variant="contained" color="primary" style={{ height: 40 }}>
                        Primary
                    </Button>
                </Box>
                <Box
                    component="span"
                    m={1}
                    className={`${classes.spreadBox} ${classes.box}`}
                >
                    <Button variant="contained" color="primary" style={{ height: 40 }}>
                        Primary
                    </Button>
                </Box>
            </div>v
        </div>
    );
};

export default Dashboard;
